    {
        long long int n,k;
        cin>>n>>k;
        vector<long long int>arr(n);
        vector<long long int>count(n,0);
        for(int i=0;i<n;i++)
        {
            cin>>arr[i];
            if(arr[i]%2==1) count[i]+=1;
        }
        for(int i=1;i<n;i++)
        {
            count[i]+=count[i-1];
        }
        if(count[n-1]<k||(count[n-1]-k)%2!=0)
        {
            cout<<"NO"<<"\n";
            continue;
        }
        else 
        {
            cout<<"YES"<<"\n";
            bool flag=true;
            int fcount=count[n-1]-k+1;
            for(int i=0;i<n;i++)
            {
                if(flag&&count[i]==count[n-1]-k+1)
                {
                    cout<<i+1<<" ";
                    flag=false;
                }
                if(!flag&&count[i]-fcount==1)
                {
                    cout<<i+1<<" ";
                    fcount++;
                }
            }
            if(arr[n-1]%2!=1)
                cout<<n;
            cout<<"\n";
        }
    }
}']

