ll gcd(ll a, ll b)
{
	while (a!= 0&&b!= 0)
	{
		if (a > b)
			a %= b;
		else
			b %= a;
	}
	return max(a, b);
}
 
ll power(ll a, ll b, ll m)
{
	ll ans=1;
	while(b)
	{
		if(b&1)
			ans=(ans*a)%m;
		b/=2;
		a=(a*a)%m;
	}
	return ans;
} 

