#include <cmath>
#include <cctype>
#include <vector>
#include <algorithm>
#include <set>
#include <map>
#include <deque>
#include <stack>
#include <unordered_set>
#include <sstream>
#include <cstring>
#include <iomanip>
#include <queue>
#include <unordered_map>
#include <x86intrin.h>

int64_t get_ans(int64_t pile1, int64_t pile2, int64_t pile_dist) {
	if(pile1 < pile2) {
		int64_t diff = pile2 - pile1;
		pile1 += std::min(pile_dist, diff);
		pile_dist -= std::min(pile_dist, diff);
	} else {
		int64_t diff = pile1 - pile2;
		pile2 += std::min(pile_dist, diff);
		pile_dist -= std::min(pile_dist, diff);
	}
	if(pile_dist == 0)
		return std::min(pile1, pile2);
	else
		return  pile1 + pile_dist / 2;
}
int main() {
	int32_t num_queries;
	std::cin >> num_queries;

	for(int32_t q = 0; q < num_queries; q++) {
		int64_t a, b, c;
		std::cin >> a >> b >> c;

		std::cout << std::max(std::max(get_ans(a, b, c), get_ans(a, c, b)), get_ans(b, c, a)) << "\n";
	}
	return 0;
}
