['#include <bits/stdc++.h>
using namespace std;

inline void sort3(int &a, int &b, int &c)
{
    if (a > b)
        std::swap(a, b);
    if (b > c)
        std::swap(b, c);
    if (a > b)
        std::swap(a, b);
}

int main() {
    int q;
    cin >> q;
    int a, b, c;
    vector<int> vi;
    while (q--) {
        cin >> a >> b >> c;
        sort3(a, b, c); // sort a, b, c from least to greatest
        cout << a << " " << b << " " << c << endl;
        int ans = (c - (b - a)) / 2 + max (a, b);
        vi.push_back(ans);
    }
    for (int i : vi) {
        cout << i << endl;
    }
}']

