const int mod=1e9+7;

void solve()
{
    int n,k;
    cin>>n>>k;

    int a[n];
    cin>>a[0];
    for(int i=1;i<n;i++)
    {
        cin>>a[i];
        a[i]+=a[i-1];
    }

    if(a[n-1]%2 != k%2)
    {
        cout<<"NO\n";
        return;
    }

    int flag=1;
    vi idx;
    for(int i=0;i<n && idx.size()<k;i++)
    {
        if(a[i]%2 == flag)
        {
            idx.pb(i+1);
            flag=1-flag;
        }
    }

    if(idx.size() < k)
    {
        cout<<"NO\n";
        return;
    }

    cout<<"YES\n";
    for(int i=0;i<idx.size()-1;i++)
    {
        cout<<idx[i]<<" ";
    }
    cout<<n<<"\n";
}

