    {
        int N, K;
        cin >> N >> K;
        vector<int> ans;
        int oddcc = 0;
        fo(i, 0, N)
        {
            int x;
            cin >> x;
            if (x % 2)
            {
                ++oddcc;
                ans.push_back(i + 1);
            }
        }
        if (oddcc < K || (N - K + 1) % 2 == 0)
        {
            cout << "NO" << endl;
