void primerange(int n)
{
	bool prime[n+1];
	memset(prime,true,sizeof(prime));
	loopeq(i,2,(int)sqrt(n))
	{
		if(prime[i])
		{
			for(int j=i*i;j<=n;j+=i)
				prime[j]=false;
		}
