['#include <bits/stdc++.h>
using namespace std;

#define debug(x) cerr << #x << ": " << x << endl

typedef long long ll;

void solve() {
  int n, k;
  cin >> n >> k;
  vector<int> a(n);
  for (int i = 0; i < n; i++) 
    cin >> a[i];
  int s = 0;
  vector<int> res;
  --k;
  for (int i = 0; i < n; i++) {
    s += a[i];
    if ((s & 1) && k) {
      res.push_back(i + 1);
      s = 0;
      --k;
    }
  }
  if (s % 2 == 0) {
    cout << "NO\n";
  } else {
    cout << "YES\n";
    for (int p : res) 
      cout << p << ' ';
    cout << n << '\n';
  }
}

int main() {
  ios::sync_with_stdio(false);
  cin.tie(0);
  int q;
  cin >> q;
  while (q--)
    solve();
  return 0;
}']

