['#include<bits/stdc++.h>
#define ll long long
#define rep(i,a,b) for(ll i=a;i<=b;i++)
#define repn(i,n) for(ll i=0;i<n;i++)
#define all(v) v.begin(),v.end()
#define bac(i,a,b) for(ll i=a;i>=b;i--)
#define sz(v) (ll)v.size()
#define vi vector<ll>
#define pi pair<ll,ll>
#define vpi vector<pair<ll,ll>>
using namespace std;

ll MOD=1e9+7, inf=1e9+5;
ll g,h,l;
const ll N=100005;

ll add(ll a,ll b, ll MOD); ll mul(ll a,ll b, ll MOD); ll binpo(ll a,ll b);

int main(){
    ios_base::sync_with_stdio(false); cin.tie(NULL);
    ll TESTS=1;
    cin>>TESTS;
    rep(i,1,TESTS){
        ll n,k;cin>>n>>k;
        ll arr[n];
        ll sum=0;
        ll cum[n+1]={0};
        repn(i,n){
            cin>>arr[i];
            sum+=arr[i];
            cum[i+1]=cum[i]+arr[i];
        }
        if(k%2!=sum%2){
            cout<<"NO";
            cout<<endl;
            continue;
        }
        sum=0;
        vector<ll> v;
        ll idx=-1;
        repn(i,n){
            if(sz(v)==k){
                break;
            }
            sum+=arr[i];
            if(sum%2){
                v.push_back(i+1);
                sum=0;
            }
            else{

            }
        }
        v.pop_back();
        if((cum[n]-cum[v.back()])%2){
            cout<<"YES"<<endl;
        }
        else{
            cout<<"NO"<<endl;
            continue;
        }
        for(auto i:v){
            cout<<i<<" ";
        }
        cout<<n<<endl;
    }
}

ll add(ll a,ll b)
{
    return (a%MOD+b%MOD)%MOD ;
}
ll mul(ll a,ll b)
{
    return (a* 1ll *b)%MOD ;
}
ll binpo(ll a,ll b)
{
    int ans = 1 ;
    while(b)
    {
        if( b % 2 != 0)
        {
            ans = mul(ans,a);
        }
        a = mul(a,a);
        b = b/2;
    }
    return ans;
}']

