['#include <stdio.h>
 int max_num(int a,int b){
 	if(a>=b)
 		return a;
 	else 
 		return b;
 }
 int main(int argc, char const *argv[])
{
	/* code */
	int q=0;
	scanf("%d",&q);
	for(int i=1;i<=q;i++){
		int arr[3];
		for(int j=0;j<3;j++){
			scanf("%d",&arr[j]);
		}
		int total=arr[1]+arr[2]+arr[3];
		int max=max_num(arr[1],arr[2]);
		max=max_num(max,arr[3]);
		if(arr[1]==max){
			arr[1]=0;
		}
		else if (arr[2]==max){
			arr[2]=0;
		}
		else if (arr[3]==max){
			arr[3]=0;
		}
		int sec_num=max_num(arr[1],arr[2]);
		sec_num=max_num(arr[3],sec_num);
		int third_num=total-max-sec_num;
		int alice=third_num+((max+sec_num-third_num)/2);
		int bob=sec_num+(max-((max+sec_num-third_num)/2));
		if(alice<=bob){
			printf("%d\n",alice);
		}
		else{
			printf("%d\n",bob );
		}

	}
	return 0;
}']

