['#include <iostream>
#include <vector>

using namespace std;

int t, n, k;
int a[200001];

void input(){
    cin >> n >> k;
    for (int i = 1; i <= n; i++){
        cin >> a[i];
    }
}

void solve(){
    vector<int> ans;
    long long int sum = 0;
    int i = 0;
    while (i <= n){
        while (!(sum % 2) && (i <= n)){
            i++;
            sum += a[i];
        }
        if (i > n){
            break;
        }
        ans.push_back(i);
        sum = 0;
    }
    cout << ans.size() << endl;
    if (ans.size() < k){
        cout << "NO\n";
        return;
    }
    cout << "YES" << endl;
    for (int i = 0; i < ans.size(); i++){
        cout << ans[i] << ((i == ans.size()-1) ? '\n' : ' ');
    }
}

int main(){
    cin >> t;
    while (t--){
        input();
        solve();
    }
}
