            a = new long[3];
            a[0] = in.nextLong();
            a[1] = in.nextLong();
            a[2] = in.nextLong();
            if (a[0] == a[1]) {
                a[0] += (a[2] / 2);
                a[1] += (a[2] / 2);
            } else if (a[0] < a[1]) {
                long diff = a[1] - a[0];
                if (diff <= a[2]) {
                    a[0] += diff;
                    a[2] -= diff;
                    a[0] += (a[2] / 2);
                    a[1] += (a[2] / 2);
                } else {
                    a[0] += a[2];
                }
            } else if (a[1] < a[0]) {
                long diff = a[0] - a[1];
                if (diff <= a[2]) {
                    a[1] += diff;
                    a[2] -= diff;
                    a[0] += (a[2] / 2);
                    a[1] += (a[2] / 2);
                } else {
                    a[1] += a[2];
                }
            }
            long min = Math.min(a[0], a[1]);
            System.out.println(min);
        }
    }

}
