        ll ma=0,mi=0,up=0;
        ma=max(a,b);
        mi=min(a,b);
        up=ma-mi;
        if(c>=up){
            s1=ma+(c-up)/2;
        }
        ma=max(b,c);
        mi=min(b,c);
        up=ma-mi;
        if(a>=up){
            s2=ma+(a-up)/2;
        }
        ma=max(a,c);
        mi=min(a,c);
        up=ma-mi;
        if(b>=up){
            s3=ma+(b-up)/2;
        }
        ll x=max(s1,max(s2,s3));
        cout<<x<<endl;
    }
}
