        counter=0;
        for(int j=0;j<n;++j)
        {
            cin>>a[j];
            if(a[j]%2==1)
                counter++;
        }
        if(k==0)
        {
            cout<<"NO"<<endl;
            continue;
        }
        else if(counter<k)
        {
            cout<<"NO"<<endl;
            continue;
        }
        else if (counter>=k && (counter%2)!=(k%2))
        {
            cout<<"NO"<<endl;
            continue;
        }
        else if(k==1 && counter>0)
        {
            cout<<"YES"<<endl;
            cout<<n<<endl;
        }
        else
