template <class T> inline bool chmax(T &a, T b) {
    if(a < b) {
        a = b;
        return 1;
    }
    return 0;
}
template <class T> inline bool chmin(T &a, T b) {
    if(a > b) {
        a = b;
        return 1;
    }
    return 0;
}
typedef long long int ll;

#define ALL(v) (v).begin(), (v).end()
#define RALL(v) (v).rbegin(), (v).rend()
#define endl "\n"
const double EPS = 1e-7;
const int INF = 1 << 30;
const ll LLINF = 1LL << 60;
const double PI = acos(-1);
const int MOD = 1000000007;
const int dx[4] = {1, 0, -1, 0};
const int dy[4] = {0, 1, 0, -1};

//-------------------------------------

void solve() {
    vector<ll> v(3);
    for(int i = 0; i < 3; i++) {
        cin >> v[i];
    }
    ll ans = -LLINF;
    for(int bit = 0; bit < (1 << 3); bit++) {
        vector<int> idx;
        int id;
        for(int i = 0; i < 3; i++) {
            if(bit & (1 << i)) {
                idx.push_back(i);
            } else {
                id = i;
            }
        }
        if(idx.size() != 2) {
            continue;
        }
        ll a = v[idx[0]];
        ll b = v[idx[1]];
        ll c = v[id];
        if(a > b) {
            swap(a, b);
        }
        ll diff = b - a;
        if(c >= diff) {
            c -= diff;
            chmax(ans, b + c / 2);
        } else {
            chmax(ans, a + c);
        }
    }
    cout << ans << endl;
}

int main() {
    cin.tie(0);
    ios::sync_with_stdio(false);
    int t;
    cin >> t;
    while(t--) {
        solve();
    }
}']

