	int lower, upper;
	Random() : lower(0), upper(10) { }
	Random(int l, int u) : lower(0), upper(10) { lower = l; upper = u; }
	void set(int l, int u) { lower = l; upper = u; }
	int get() { return rand() % upper + lower; }
