		return 0;
	}
	compile();
	return 0;
}

class Solution {

public:

	void run() {
		input();

		ll a = abc[0], b = abc[1];

		ll diff = b - a;

		if (diff <= abc[2]) {
			abc[2] -= diff;
			a += diff;
			a += abc[2] / 2;
			LOG(a);
		}
		else {
			a += abc[2];
			abc[2] = 0;
			LOG(a);
		}

	}

