/*---------------------------------------------------------------------*/
using namespace std;
int main(){
    int t;
    sf(t);
    while(t--){
        int n, k;
        sff(n,k);
        int a[n+10];
        ll cum[n+10];
        cum[0]=0;
        std::vector<int> v;
        int p = 0,c=0;
        for (int i = 1; i <= n; ++i){
            sf(a[i]),cum[i]=cum[i-1]+a[i];
            if(cum[i]-cum[p]&1)c++,v.pb(i),p=i;
        }
        if(c==k){
            printf("YES\n");
            for(auto x:v)printf("%d ", x);
        }
        else printf("NO");
        cout<<endl;
    }
    return 0;
}

