                else{
                    if(i != 0) risposta[j++] = i+1;
                    k--;
                    sum = 0;
                }
            }
        }
        cout << "YES\n";
        for(int i = 0; i < K; i++) cout << risposta[i] << " ";
        cout << "\n";
