#include <ext/pb_ds/assoc_container.hpp>
#include <ext/pb_ds/tree_policy.hpp>


#define int  long long
#define rep(i,a,b)    for(int i=a;i<b;i++)
#define repn(i,a,b)   for(int i=a;i>=b;i--)
#define F first
#define S second
#define pii pair<int,int>
#define vi vector<int>
#define vii vector<pii>
#define pb push_back
#define eb emplace_back //FASTER THAN PUSH BACK!
#define mp  make_pair
#define all(v) (v).begin(), (v).end()
#define mod 1000000007
#define mi multiset<int>
#define mii multiset<pii>
#define what_is(x) cerr << #x << " is " << x <<"\n";
// ordered_set adds two new functions to set - (set).find_by_order([kth element based on zero indexing]) and order_of_key()
// order_of_key returns number of elements less that parameter. If element exists, that order is its index
#define ordered_set tree<ll, null_type, less<ll>, rb_tree_tag, tree_order_statistics_node_update>


using namespace __gnu_pbds;
using namespace std;


int modp(int a,int n,int m)
{
    if(n==0) return 1;
    if(n==1) return a%m;
    int res=modp(a,n/2,m);
    if(n%2==0) return (res*res)%m;
    else return (a*res*res)%m;
}

int isprime(int n)
{
    if(n==1) return 0;
    if(n==2) return 1;
    if(n==3) return 1;
    if(n==4) return 0;
    for(int i=2;i<=sqrt(n);i++)
    {
        if(n&i==0) return 0;
    }
}

void solve()
{
    int t,n,m,i,k,l,j,s,sum=0,Pos,flag=0,count=0;
    string S,T,U;
    cin>>n>>k;
    int a[n];
    vi pos;
    rep(i,0,n)
    {
        cin>>a[i];
        sum+=a[i];
        if(sum%2&&k)
        {
            sum=0;
            k--;
            pos.pb(i+1);
        }
        
    }
    if(k==0) 
    {
        cout<<"YES\n";
        for(auto x:pos) cout<<x<<" ";
        m=pos.size();
        if(pos[m-1]!=n) cout<<n;
    }
    else cout<<"NO";
}

signed main()
{
    int t;
    cin>>t;
    while(t--)
    {
        solve();
        cout<<"\n";
    }
    return 0;
}
