    if (idx == a.size()) {
        return k == 0;
    }
    sum += a[idx];
    if (sum % 2) {
        if (k > 1 || idx == a.size() - 1) {
            res.push_back(idx + 1);
            return solve(idx + 1, a, k - 1, 0LL);
        }
        else {
            return solve(idx + 1, a, k, sum);
        }
    }
    return solve(idx + 1, a, k, sum);
}

