            sum += arr[i];
            i++;
        }
        if(sum % 2 == 0){
            cout << "NO\n";
            continue;
        }
        cout << "YES\n";
        for(auto it = vec.begin() ; it != vec.end() ; it++){
            cout << *it << " ";
        }cout << n << "\n";
    }
    return 0;
}']

