['#include<bits/stdc++.h>
#define int long long int
#pragma GCC optimization ("O3")
#pragma GCC optimization ("unroll-loops")
#pragma GCC target("sse,sse2,sse3,ssse3,sse4,popcnt,abm,mmx,avx,tune=native")
#define pb push_back
#define inf 0x3f3f3f3f
#define print(x) printf("%lld ",x);
#define scan(x) scanf("%lld",&x)
#define line printf("\n");
#pragma GCC target ("sse4.2")
#define M 998244353
using namespace std;
template<typename T> void mmax(T& x, T y) {x = max(x, y);}
template<typename T> void mmin(T& x, T y) {x = min(x, y);}
/**************************/
 
/**** FAST IO ****/
inline int readChar();
template <class T = int> inline T co();
template <class T> inline void ci( T x, char end = 0 );
inline void writeChar( int x );
inline void writeWord( const char *s );
 
/** Read */
 
static const int buf_size = 4096;
 
inline int getChar() {
	static char buf[buf_size];
	static int len = 0, pos = 0;
	if (pos == len)
		pos = 0, len = fread(buf, 1, buf_size, stdin);
	if (pos == len)
		return -1;
	return buf[pos++];
}
 
inline int readChar() {
	int c = getChar();
	while (c <= 32)
		c = getChar();
	return c;
}
 
template <class T>
inline T co() {
	int s = 1, c = readChar();
	T x = 0;
	if (c == '-')
		s = -1, c = getChar();
	while ('0' <= c && c <= '9')
		x = x * 10 + c - '0', c = getChar();
	return s == 1 ? x : -x;
}
 
/** Write */
 
static int write_pos = 0;
static char write_buf[buf_size];
 
inline void writeChar( int x ) {
	if (write_pos == buf_size)
		fwrite(write_buf, 1, buf_size, stdout), write_pos = 0;
	write_buf[write_pos++] = x;
}
 
template <class T>
inline void ci( T x, char end ) {
	if (x < 0)
		writeChar('-'), x = -x;
 
	char s[24];
	int n = 0;
	while (x || !n)
		s[n++] = '0' + x % 10, x /= 10;
	while (n--)
		writeChar(s[n]);
	if (end)
		writeChar(end);
}
 
inline void writeWord( const char *s ) {
	while (*s)
		writeChar(*s++);
}
 
struct Flusher {
	~Flusher() {
		if (write_pos)
			fwrite(write_buf, 1, write_pos, stdout), write_pos = 0;
	}
} flusher;






const int N=200005;








void solve()
{
	int n,k;
	cin>>n>>k;
	int a[n];
	int cnt=0;
	for(int i=0;i<n;i++)cin>>a[i],a[i]&=1,cnt+=a[i];
	if(cnt==k){
		cout<<"YES\n";
		for(int i=0;i<n;i++)
				if(a[i])cout<<i+1<<" ";
			cout<<endl;
}
	else if(cnt > k){
		if((cnt-k+1) %2==0)cout<<"NO";
		else {
			cout<<"YES\n";
			for(int i=0,cnt1=0;i<n and cnt1<k-1;i++)
				if(a[i]&1)cout<<i+1<<" ",cnt1++;
			cout<<n;
		}
		cout<<endl;
	}
	else cout<<"NO\n";
}


int32_t main()
{
	#ifndef ONLINE_JUDGE
freopen("input.txt", "r", stdin);
freopen("output.txt",  "w", stdout);
#endif
	int t;cin>>t; while(t--)
	solve();
	
	return 0;
}']

