['#include <cstdio>
typedef long long ll;

ll q, n, k, a, ans[200010], sum[200010], cnt, last;

int main(){

    scanf("%lld", &q);
    while(q--){
        cnt = last = 0;
        scanf("%lld%lld", &n, &k);
        for(ll i=1; i<=n; i++){
            scanf("%lld", &a);
            sum[i] = sum[i - 1] + a;        // 前缀和
        }
        for(ll i=1; i<=n; i++){
            if(cnt + 1 == k) break;         // 分了 k-1 部分就跳出，把剩下的全部归为第 k 部分
            if((sum[i] - sum[last]) & 1){
                ans[++cnt] = i;
                last = i;
            } 
        }
        if(cnt + 1 == k && ((sum[n] - sum[last]) & 1)){ //注意特判最后一组
            puts("YES");
            for(ll i=1; i<=cnt; i++)    
                printf("%lld ", ans[i]);
            printf("%lld\n", n);
        }
        else puts("NO");
    }
    return 0;
}']

