#define v64 vector<ll>
#define s32 set<int>
#define s64 set<ll>
#define graph vector<v32>
#define p32 pair<int, int>
#define p64 pair<ll, ll>
#define sz(v) (ll)(v).size()
#define fi first
#define se second
#define ln '\n'
#define debug(x) cerr << (#x) << ": " << (x) << ln
mt19937 rng(chrono::steady_clock::now().time_since_epoch().count());
inline ll add(ll a, ll b, ll m) { return (((a % m + b % m) % m + m) % m); }
inline ll mul(ll a, ll b, ll m) { return (((a % m * b % m) % m + m) % m); }
const double EPS = 1e-6;
const ll MOD = 1e9 + 7;
template <typename T, typename U>
ostream &operator<<(ostream &out, const pair<T, U> &p)
{
	out << '[' << p.fi << ", " << p.se << ']';
	return out;
}
template <template <typename, typename...> class ContainerType, typename ValueType, typename... Args>
void print_container(const ContainerType<ValueType, Args...> &c)
{
	cout << "{ ";
	for (const auto &v : c)
		cout << v << ' ';
	cout << '}' << ln;
}

void solve()
{
	int n, k;
	cin >> n >> k;
	v32 arr(n, 0);
	int even = 0, odd = 0;
	ll sum = 0;
	for (int i = 0; i < n; i++)
	{
		cin >> arr[i];
		sum += arr[i];
		if (arr[i] & 1)
			odd++;
		else
			even++;
	}
	if (k == 1)
	{
		if (sum % 2)
		{
			cout << "YES" << ln;
			cout << n << ln;
		}
		else
			cout << "NO" << ln;
		return;
	}
	if (odd < k)
		cout << "NO" << ln;
	else
	{
		v32 ans;
		int rem = k - 1;
		for (int i = 0; i < n; i++)
		{
			if (rem == 0)
				break;
			if (arr[i] & 1)
			{
				ans.push_back(i + 1);
				rem--;
			}
		}
		rem = odd - k + 1;
		if (rem & 1)
			ans.push_back(n);
		else
		{
			if (rem < 3)
			{
				cout << "NO" << ln;
				return;
			}
			else
			{
				int idx = ans[sz(ans) - 1];
				int i = idx;
				while (i < n)
				{
					if (arr[i] & 1)
						break;
					i++;
				}
				ans[sz(ans) - 1] = i + 1;
				ans.push_back(n);
			}
		}
		cout << "YES" << ln;
		for (auto itr : ans)
			cout << itr << " ";
		cout << ln;
	}
	return;
}

int main()
{
	FASTIO;
#ifdef file_input
	freopen("input.txt", "r", stdin);
	freopen("output.txt", "w", stdout);
#endif
	clock_t start, stop;
	int t = 1;
#ifdef multitest
	cin >> t;
#endif
#ifdef measure_time
	start = clock();
#endif
	for (int tc = 1; tc < t + 1; tc++)
		solve();
#ifdef measure_time
	stop = clock();
	cerr << "Time :" << fixed << setprecision(5) << double(stop - start) / double(CLOCKS_PER_SEC) << "s" << ln;
#endif
	return 0;
}
