['import java.util.*
import kotlin.math.max
import kotlin.math.min

fun solve(): Unit {
    val scan = Scanner(System.`in`)

    val q: Int = scan.nextInt()

    for (i: Int in 1..q) {
        val n: Int = scan.nextInt()

        var maxx = 10000
        var maxy = 10000
        var minx = -10000
        var miny = -10000

        for (j in 1..n) {

            val x = scan.nextInt()
            val y = scan.nextInt()
            val f1 = scan.nextInt()
            val f2 = scan.nextInt()
            val f3 = scan.nextInt()
            val f4 = scan.nextInt()

            if (f1 == 0) minx = max(minx, x)
            if (f2 == 0) maxy = min(maxy, y)
            if (f3 == 0) maxx = min(maxx, x)
            if (f4 == 0) miny = max(miny, y)
        }

        if(minx > maxx || miny > maxy) println(0)
        else println("1 $minx $maxy")
    }
}

fun main() {
    solve()
}']

