int num =odd/div ;
for(int i=0;i<n;++i){
if(x[i]%2!=0)c++ ;
if(c==div){
 v.insert(i+1) ;
 c2++ ;
 c=0 ;
 if(c2==num){
    num=-1 ;
    div =mod ;
 }
}
}
puts("YES") ;
int fin ;
 for(int i = 0 ;i < n && k-1 > 0;i++){
        if(x[i] % 2 == 1){
            printf("%d ",i + 1);
            k--;
        }
