['class ThreePilesOfCandies {
    fun shareCandies(arr: Array<Long>): Long = (arr.fold(0.toLong()) { a, e -> a + e} / 2).toLong()
}

fun main() {
    val test: ThreePilesOfCandies = ThreePilesOfCandies()

    val q: Int = readLine()!!.toInt()

    for (i: Int in 0..q) {
        val arr: Array<Long> = readLine()!!.split(" ").map { e -> e.toLong() }.toTypedArray()
        println(test.shareCandies(arr))
    }
}']

