	if(b - a > 0) {
		if(c >= b - a) {
			tempa += b - a;
			tempc -= b - a;
		} else {
			tempa += c;
			tempc = 0;
		}
		if(c > 0) {
			tempa += tempc / 2;
			tempb += tempc / 2;
			tempc = 0;
		}
	}
	else if(b - a < 0) {
