['#include <bits/stdc++.h>
using namespace std;

bool solve(){
    
    
    int n,k;
	cin>>n>>k;
	
	int arr[n];
	
	for(int i=0;i<n;i++)
	cin>>arr[i];
	
	long long int sum[n];
	sum[0]=arr[0];
	
	for(int i=1;i<n;i++)
	sum[i]=sum[i-1]+arr[i];
	
// 	for(int i=0;i<n;i++)
// 	cout<<sum[i]<<" ";
	
	
	int curr_pos=-1;
	
	vector<int> ans;
	
	for(int i=0;i<n;i++){
	    
	    if(curr_pos==-1){
	        if(sum[i]%2!=0){
	            ans.push_back(i+1);
	            curr_pos=i;
	            k--;
	        }
	    }
	    else{
	        if((sum[i]-sum[curr_pos])%2!=0){
	            ans.push_back(i+1);
	            curr_pos=i;
	            k--;
	        }
	    }
	    
	}
	
	
	if(k==0){
	    std::cout << "YES" << std::endl;
	    for(int j=0;j<ans.size();j++)
	    cout<<ans[j]<<" ";
	    cout<<endl;
	}
	else
	std::cout << "NO" << std::endl;
	
    
}


int main() {
	
	int t;
	cin>>t;
	
	while(t--){
	solve();
	}
	
	
	return 0;
}']

