["#include <bits/stdc++.h>
#include <ext/pb_ds/tree_policy.hpp>
#include <ext/pb_ds/assoc_container.hpp>
using namespace std;

#define LEN(x) (int)x.size()
#define ALL(x) x.begin(), x.end()

using ll = long long;
using vi = vector<int>;
using vvi = vector<vi>;
using pii = pair<int,int>;
using vpii = vector<pii>;

template<typename T, typename M = __gnu_pbds::null_type>
using ordered_set = __gnu_pbds::tree<T, M, less<T>, __gnu_pbds::rb_tree_tag, __gnu_pbds::tree_order_statistics_node_update>;

template<typename T>
const T INF = (is_same<T, int>::value ? 1e9 : 1e18);
const int MOD = 1e9 + 7;
const double EPS = 1e-9;

inline int fcmp(double x, double y)
{ return (x < y + EPS ? (x < y - EPS ? -1 : 0) : 1);}

int main()
{
    ios_base::sync_with_stdio(false);
    cout.precision(10);
    
    int q; cin >> q;
    while(q--)
    {
        vector<ll> x(3);
        for(ll& i : x) cin >> i;
        sort(ALL(x));
        ll d = x[1] - x[0];
        x[0] += min(d, x[2]);
        x[2] -= min(d, x[2]);
        x[0] += x[2] / 2;
        cout << x[0] << '\n';
    }
    
    return 0;
}"]

['#include <bits/stdc++.h>
#include <ext/pb_ds/tree_policy.hpp>
#include <ext/pb_ds/assoc_container.hpp>
using namespace std;

#define LEN(x) (int)x.size()
#define ALL(x) x.begin(), x.end()

using ll = long long;
using vi = vector<int>;
using vvi = vector<vi>;
using pii = pair<int,int>;
using vpii = vector<pii>;

template<typename T, typename M = __gnu_pbds::null_type>
using ordered_set = __gnu_pbds::tree<T, M, less<T>, __gnu_pbds::rb_tree_tag, __gnu_pbds::tree_order_statistics_node_update>;

template<typename T>
const T INF = (is_same<T, int>::value ? 1e9 : 1e18);
const int MOD = 1e9 + 7;
const double EPS = 1e-9;

inline int fcmp(double x, double y)
{ return (x < y + EPS ? (x < y - EPS ? -1 : 0) : 1);}

int main()
{
    ios_base::sync_with_stdio(false);
    cout.precision(10);
    
    int q; cin >> q;
    while(q--)
    {
        int n, k; cin >> n >> k;
        int odd = 0;
        vi ans;
        for(int i = 1; i <= n; i++)
        {
            int a; cin >> a; 
            if(a % 2)
            {
                odd++;
                if(LEN(ans) < k) ans.emplace_back(i);
            }
        }

        if(odd >= k && (odd - k) % 2 == 0)
        {
            cout << "YES\n";
            for(int i = 0; i < k; i++)
                cout << ans[i] << " \n"[i == k - 1];
        }
        else cout << "NO\n";
    }
    
    return 0;
}']

