        for (int i = 0; i < n; ++i) {
            cin >> a[i];
        }
        ll s = 0;
        set<int> ans;
        int fk = k;
        k--;
        for (int j = 0; j < n; ++j) {
            if (((s + a[j]) & 1) && k) {
                s = 0;
                ans.insert(j);
                k--;
            } else s += a[j];
        }
        ans.insert(n - 1);
