['#include <iostream>
#include <vector>

using namespace std;

void printAnswer(vector<int> answer, bool possible, int n){
    if(possible){
        cout << "YES" << endl;
        for(int i = 0; i < answer.size(); i++){
            cout << answer[i] << ' ';
        }
        cout << n << endl;
    }
    else{
        cout << "NO" << endl;
    }
}
void solveProblem(){
    bool possible = false;
    int n, k;
    vector<int> answer;
    cin >> n >> k;
    int foundcount = 0;
    int oddcount = 0;
    for(int i = 0; i < n; i++){
        int x;
        cin >> x;
        if(foundcount < k - 1){
            if(x % 2 == 1){
                answer.push_back(i+1);
                foundcount++;
            }
        }
        else{
            if(x % 2 == 1){
                oddcount++;
            }
        }
    }
    if(oddcount % 2 == 1 && !(foundcount < k -1)){
        possible = true;
    }
    printAnswer(answer, possible, n);
}
int main(){
    int num;
    cin >> num;
    for(int i = 0; i < num; i++){
        solveProblem();
    }
    return 0;
}']

