['#include <bits/stdc++.h>

#define ll          long long
#define ld          long double
#define pb          push_back
#define pf          push_front
#define mp          make_pair
#define pll         pair<ll,ll>
#define vl          vector<ll>
#define sl          set<ll> 
#define vll         vector<pll>
#define ml          map<ll,ll>
#define mll         map<pll,ll>
#define all(a)      a.begin(),a.end()
#define x           first
#define y           second
#define sz(x)       (ll)x.size()
#define endl        '\n'
#define mod         (ll)1000000007
#define lp(i,a,b)   for(ll i=a;i<b;++i)
#define lpr(i,a,b)  for(ll i=a;i>=b;i--)
#define lpd(i,x)    for(auto i:x)
#define ios         ios_base::sync_with_stdio(false);cin.tie(0);cout.tie(0);
ll inf = (ll)1e18;
ld pi = 3.141592653589;
using namespace std;

ll bpow(ll x, ll v) {	
	if (v == 0)
		return 1 % mod;
	if (v % 2 == 1)
		return (x * bpow(x, v - 1)) % mod;
	ll r = bpow(x, v / 2);
	return (r * r) % mod;	
}

ll lcm(ll a,ll b)
{
	ll ret=(a*b)/__gcd(a,b);
	return ret;
} 

ll solve(){ 
	ll n,k; cin>>n>>k;
	ll s=0;
	vl a(n),b; lp(i,0,n) cin>>a[i],s+=a[i];
	if((k%2 and s%2==0) or (k%2==0 and s%2)){
		cout<<"NO\n";
		return 0;
	}
	ll p=0;
	lp(i,0,n){
		p+=a[i];
		if(p%2){
			b.pb(i+1);
			if(sz(b)==k-1)
				break;
			p=0;
		}
	}
	b.pb(n);
	if(b[k-1]!=n) {
		cout<<"NO"<<endl;
		return 0;
	}
	cout<<"YES"<<endl;
	lp(i,0,k) cout<<b[i]<<" ";
	cout<<endl;
}
int main(){
    ios
    ll t=1; 
    cin>>t;
    while(t--){
    	solve();
    }
}']

