            cin >> candy[i];
        }

        vector<int> vec = { 0,1,1 };
        do {
            ll left_candy;
            ll a = 0, b = 0;

            for (int i = 0; i < 3; ++i) {
                if (vec[i] == 0) {
                    left_candy = candy[i];
                    continue;
                }
                if (a == 0) a = candy[i];
                else b = candy[i];
            }

            ll diff = abs(a - b);
            ll MIN = min(a, b);
            ll MAX = max(a, b);
            if (left_candy <= diff) answer = max(answer, MIN + left_candy);
            else answer = max(answer, MAX + (left_candy - diff) / 2);

        } while (next_permutation(vec.begin(), vec.end()));

