ll fastpower(ll x,ll n,ll M){ 
  if(n==0)             return 1;
    else if(n%2 == 0)   return fastpower((x*x)%M,n/2,M);          // n is even
    else                return (x*fastpower((x*x)%M,(n-1)/2,M))%M; 
 }// n is odd

ll GCD(ll A, ll B) { if(B==0) return A;   else return GCD(B, A % B); }

