    for (auto a: S)
        cout << a << " ";
    return out;
}

template<typename T>
ostream& operator<<(ostream& out, const multiset<T>& S) {
    for (auto a: S)
        cout << a << " ";
    return out;
}

template<typename S, typename T>
ostream& operator<<(ostream& out, const map<S, T>& M) {
    for (auto m: M)
        cout << "(" << m.first << "->" << m.second << ") ";
    return out;
}

template<typename S, typename T>
pair<S, T> operator+(pair<S, T> a, pair<S, T> b) {
    return make_pair(a.first + b.first, a.second + b.second);
}

template<typename S, typename T>
pair<S, T> operator-(pair<S, T> a, pair<S, T> b) {
    return make_pair(a.first - b.first, a.second - b.second);
}

long long query(long long a, long long b, long long c) {
    if (a > b)
        swap(a, b);
    if (c <= b - a) {
        a += c;
        return min(a, b);
    }
    c -= (b - a);
    a = b;
    a += c / 2;
    b += (c + 1) / 2;
    return min(a, b);
}

long long solve(vector<long long>& A) {
    long long max_val = 0;
    for (int i = 0 ;i < 3; i++) {
        for (int j = 0; j < 3; j++) {
            if (i != j) {
                long long val = query(A[i], A[j], A[3-i-j]);
                max_val = max(max_val, val);
            }
        }
    }
    return max_val;
}

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0);
    int cas;
    cin >> cas;
    while (cas--) {
        vector<long long> A(3);
        for (int i = 0; i < 3; i++)
            cin >> A[i];
        long long ans = solve(A);
        cout << ans << endl;
    }
    return 0;
}
