['class OddSumSegment {
    fun sums(n: Int, k: Int, arr: Array<Int>): Unit {

        val oddPositions: MutableList<Int> = mutableListOf<Int>()

        val odds: Int = arr.foldIndexed(0) {
                i, a, e ->
            if (e % 2 == 1) {

                oddPositions.add(i + 1)

                a + 1
            }
            else a
        }

        when {
            odds < k -> println("NO")
            k % 2 != odds % 2 -> println("NO")
            else -> {
                println("YES")
                for (i in oddPositions.indices) {
                    if(i < k - 1) print("${oddPositions[i]} ")
                }
                println(oddPositions.last())
            }
        }
    }
}

fun main() {

    val sol = OddSumSegment()

    val q: Int = readLine()!!.toInt()

    for (i: Int in 0 until q) {
        val arr: Array<Int> = readLine()!!.split(" ").map { e -> e.toInt() }.toTypedArray()
        val arr2: Array<Int> = readLine()!!.split(" ").map { e -> e.toInt() }.toTypedArray()
        sol.sums(arr[0], arr[1], arr2)
    }
}

