#define mset multiset
#define LB lower_bound
#define UB upper_bound
#define mp make_pair
#define pb push_back
#define in insert
#define s second
#define f first
#define pQueue priority_queue
#define maxElement *max_element
#define minElement *min_element
#define MAX 100000LL
#define mod 1000000007LL
#define inf 1000000000000000000LL
#define mI2 500000004LL
inline ll add(ll a, ll b){ return ((a%mod)+(b%mod))%mod;}
inline ll mul(ll a, ll b){ return ((a%mod)*(b%mod))%mod;}
inline ll sub(ll a, ll b){ return ((a%mod)-(b%mod)+mod)%mod;}

ll findAns(ll x, ll y, ll z){
    if(x>y){
        swap(x,y);
    }
    ll temp=min(z,y-x);
    z-=temp;
    x+=temp;
    x+=(z/2);
    return x;
}

void Flash(){
    ll a[3];
    for(ll i=0;i<3;i++){
        cin>>a[i];
    }
    ll ans=0;
    ll alice,bob;
    alice=a[0],bob=a[1];
    ans=max(ans,findAns(a[0],a[1],a[2]));
    ans=max(ans,findAns(a[0],a[2],a[1]));
    ans=max(ans,findAns(a[1],a[2],a[0]));
    cout<<ans<<"\n";
}

int main(int argc, char const *argv[]){
    ThunderClap;
    ll t=1;
    cin>>t;
    for(ll i=1;i<=t;i++){
        //cout<<"Case #"<<i<<": ";
        Flash();
    }
    return 0;
}']

