inline ll mul(ll a, ll b){ return ((a%mod)*(b%mod))%mod;}
inline ll sub(ll a, ll b){ return ((a%mod)-(b%mod)+mod)%mod;}

void Flash(){
    ll n,k;
    cin>>n>>k;
    ll a[n];
    vi<ll>ans;
    --k;
    for(ll i=0;i<n;i++){
        cin>>a[i];
        a[i]&=1;
    }
    ll xr=0;
    for(ll i=0;i<n;i++){
        xr^=a[i];
        if(xr){
            if(k){
                ans.pb(i+1);
                xr=0;
                --k;
            }
        }
    }
    ans.pb(n);
