int main()
{
    int n;
    scanf("%d",&n);
    long long arr[n][3];

    int i,j,k;
    long long temp;
    for(i=0;i<n;i++)
    {
        for(j=0;j<3;j++)
        {
            scanf("%lld",&arr[i][j]);
        }
    }

    for(i=0;i<n;i++)
    {
        for(j=0;j<3;j++)
        {
            for(k=j+1; k<3;k++)
            {
                if(arr[i][j] > arr[i][k])
                {
                    temp=arr[i][j];
                    arr[i][j]=arr[i][k];
                    arr[i][k]=temp;
                }
            }
        }
    }
    long long one_req,rem_from_last_pile,divide,so_max_now;

    for(i=0;i<n;i++)
    {


            one_req=arr[i][1]-arr[i][0];
            rem_from_last_pile=arr[i][2]-one_req;
            divide=rem_from_last_pile / 2;
            so_max_now=arr[i][1] + divide;

            printf("%lld\n",so_max_now);


    }
    return 0;
}
