const int N = 2e5+2;

int main()
{
    int t;
    scn(t);

    while(t --)
    {
    	ll a[3];

    	rep(i, 0, 3)
    	lscn(a[i]);

    	sort(a, a+3);

    	ll al = a[0], bo = a[1];

    	ll dif = (bo - al);

    	ll aval = min(dif, a[2]);

    	al += aval;

    	a[2] -= aval;

    	a[2] /= 2;

    	al += a[2], bo += a[2];

    	ll ans = min(al, bo);

    	lprin(ans);
    }
    return 0;
}']

