['import java.util.Scanner;

public class ThreePilesOfCandies {
	public static void main(String[] args) {

		Scanner in = new Scanner(System.in);
		int q = in.nextInt(), i;

		for (i = 0; i < q; i++) {
			long a = in.nextLong(), b = in.nextLong(), c = in.nextLong(), big = Math.max(a, b), small = Math.min(a, b);

			big += Math.floor((double)c / 2);
			small += Math.ceil((double)c / 2);

			System.out.println(small + (big - small) / 2);
		}
		in.close();
	}
}
