['/* Simplicity and Goodness */

#include <bits/stdc++.h>
#define ll long long
#define scn(n) scanf("%d",&n)
#define lscn(n) scanf("%lld",&n)
#define lpri(n) printf("%lld ",n)
#define pri(n) printf("%d ",(int)n)
#define prin(n) printf("%d\n",(int)n)
#define lprin(n) printf("%lld\n",n)
#define rep(i,ini,n) for(int i=ini;i<(int)n;i++)
#define pb push_back
#define mp make_pair
#define F first
#define S second
#define inf INT_MAX
#define ninf INT_MIN
using namespace std;
const ll mod = 998244353;
const int N = 2e5+2;

int main()
{
    int t;
    scn(t);

    while(t --)
    {
        int n, k;
        scn(n); scn(k);

        int a[n];
        vector < int > v;

        rep(i, 0, n)
        {
            scn(a[i]);

            if(a[i] & 1)
            v.pb(i+1);
        }

        int sz = v.size();

        if(((sz % 2) != (k % 2)) || (sz < k))
        {
            printf("NO\n");
            continue;
        }

        printf("YES\n");

        rep(i, 0, k-1)
        pri(v[i]);

        prin(v[sz - 1]);
    }
    return 0;
}']

