['import java.math.BigInteger

fun main() {
    val queries = Integer.parseInt(readLine()!!)
    for (i in 0 until queries) {
        val piles = readLine()!!.split(" ")
            .map{it.toBigInteger()}
            .toMutableList()

        // A takes smallest
        // B takes middle
        // Split biggest

        var a = BigInteger("0")
        var b = BigInteger("0")

        val smallest = piles.min() ?: BigInteger.ZERO
        a += smallest
        piles.remove(smallest)

        val middle = piles.min() ?: BigInteger.ZERO
        b += middle
        piles.remove(middle)

        val max = piles.min() ?: BigInteger.ZERO
        val diff = b - a

        if (max == diff) {
            a += diff
        } else {

            // give diff to A
            a += diff

            // split remainder
            val remainder = max - diff
            val split = remainder / BigInteger("2")
            a += split
            b += split
        }

        println(a)
    }
}']

