['import java.util.Scanner;

public class Solution {
	public static void main(String[] args) {
	    Scanner s = new Scanner(System.in);
		int q = s.nextInt();
		for (int i = 0; i < q; i++) {
			long a = s.nextLong();
			long b = s.nextLong();
			long c = s.nextLong();
			long p__a = p_a(a,b,c);
			long p__b = p_b(a,b,c);
			long p__c = p_c(a,b,c);
			long winner = Math.max(p__a, Math.max(p__b,p__c));
			System.out.println(winner);
		}
	}
	public static long p_b(long a, long b, long c) {
		long small = Math.min(a,c);
		long big = Math.max(a,c);
		if (b < (big - small)) {
			return b + small;
		}
		else {
			small += big - small;
			b -= Math.max(a,c) - Math.min(a,c);
			small += b / 2;
			return small;
		}
	}
	public static long p_c(long a, long b, long c) {
		long small = Math.min(a,b);
		long big = Math.max(a,b);
		if (c < big - small) {
			return c + small;
		}
		else {
			small += big - small;
			c -= Math.max(a,b) - Math.min(a,b);
			small += c / 2;
			return small;
		}
	}
	public static long p_a(long a, long b, long c) {
		long small = Math.min(b,c);
		long big = Math.max(b,c);
		if (a < (big - small)) {
				return a + small;
		}
		else {
			small += (big - small);
			a -= Math.max(c,b) - Math.min(c,b);
			small += a / 2;
			return small;
		}
	}
}']

