['/**
    हमने तुम्हे जिस सिद्दत से चाहा वो हम जानते हैं,
    पड़ जिसकी तुम हो उसके मोहब्बत की ताकत क्या रही होगी.
**/
/**

**/

#include <bits/stdc++.h>

#define ll                   long long
#define MOD                  (ll)(1e9 + 7)
#define INF                  (ll)1e18
#define fast()               ios_base::sync_with_stdio(false);  cin.tie(NULL);
#define loop(i,a,b)          for(ll i=(ll)a;i<(ll)b;i++)
#define pool(i,a,b)          for(ll i=(ll)a;i>=(ll)b;i--)
#define pb                   push_back
#define vi                   vector<ll>
#define endl                 "\n"
#define param                greater<ll>()
#define ff                   first
#define ss                   second
#define all(v)               v.begin(),v.end()
#define dbg(x)               cout<<#x<<" is: "<<x<<endl;

using namespace std;

bool isvowel(char c){if(c=='a' || c=='e' || c=='i' || c=='o' || c=='u' || c=='A' || c=='E' || c=='I' || c=='O' || c=='U')return true;return false;}

ll fast_exp(ll x,ll n){ll ans=1;while(n){if(n&1)ans*=x;n=n>>1;x=x*x;}return ans;}

ll mod_exp(ll x, ll y,ll p){ll res = 1;x = x % p;while(y>0){if(y&1)res = (res*x) % p;y = y>>1;x=(x*x)%p;}return res;}

ll sod(ll n){ll sum = 0;    while(n!=0){sum=sum+(n%10);n=n/10;}     return sum;}

ll modInverse(ll a, ll m){  return mod_exp(a, m-2, m);} 

ll nCrModpDP(ll n,ll r,ll p) 
{
    ll C[r+1]; 
    memset(C,0,sizeof(C)); 
    C[0]=1;
    for(ll i=1;i<=n;i++) 
    { 
        for (ll j=min(i,r);j>0;j--) 
            C[j]=(C[j]+C[j-1])%p; 
    } 
    return C[r]; 
} 
 
ll nCrModpLucas(ll n,ll r,ll p) 
{
    if(r==0) 
        return 1; 
    ll ni=n%p,ri=r%p; 
    return(nCrModpLucas(n/p,r/p,p)*nCrModpDP(ni,ri,p))%p;

    //O(p2 * logp(n)) 
} 

/*End of template */

void solve()
{
    ll sum=0,x;
    loop(i,0,3)
    {
    	cin>>x;
    	sum+=x;
    }		

    cout << sum/2 << endl;
}

int main()
{

	#ifndef ONLINE_JUDGE
    	freopen("input.txt", "r", stdin);
    	freopen("output.txt", "w", stdout);
	#endif


    fast()

    ll t;
    cin>>t;
    //t=1;
    while(t--)
        solve();


    #ifndef ONLINE_JUDGE
    	cout<<"\nTime Elapsed: " << 1.0*clock() / CLOCKS_PER_SEC << " sec\n";
	#endif

}']

