		for(ll i=0;i<3;i++)
		{
			cin>>arr[i];
		}
		for(ll i=0;i<3;i++)
		{
			for(ll j=i+1;j<3;j++)
			{
				x=arr[i];
				y=arr[j];
				loc=(3-i-j);
				ll minnum=min(x,y);
				ll maxnum=max(x,y);
				if(minnum+arr[loc]<=maxnum)
				{
					ans=max(ans,minnum+arr[loc]);
				}
				else
