        if l[j]%2!=0:
            l1.append(j)
            c+=1
    if k>c:
        print("NO")
    else:
        l1[-1]=n-1
        if (k+c)%2!=0:
            print("NO")
        else:
            print("YES")
            l2=[]
            x=len(l1)
            for j in range(k):
                l2.append(l1[x-1-j]+1)
            print(*l2[::-1])
    
            
        
    
        
                
        
    
    
        
        
        
    
