#include <bits/stdc++.h>
using namespace std;

int main()
{
#ifndef ONLINE_JUDGE
    freopen("input.txt", "r", stdin);
    freopen("output.txt", "w", stdout);
#endif

    int q;
    cin >> q;
    while (q--) {
        ll a, b, c;
        cin >> a >> b >> c;

        if (a == b && a == c) {
            cout << a + c / 2 << endl;
            continue;
        }
        ll max1 = max(a, max(b, c));
        ll max3 = min(a, min(b, c));

        ll max2;
        if (a > b && a < c || a > c && a < b) {
            max2 = a;
        } else if (b > a && b < c || b > c && b < a) {
            max2 = b;
        } else if (c < a && c > b || c > a && c < b) {
            max2 = c;
        }

        ll x = max2 - max3;
        max3 = max3 + x;
        max1 = max1 - x;

        max3 = max3 + max1 / 2;
        cout << max3 << endl;
    }


    return 0;
}
