bool ispalindrome(string s)
{
    int n = s.length();
    if (n <= 1)
        return true;
    if (n == 2 && s[1] == s[0])
        return true;
    else if (n == 2 && s[0] != s[1])
        return false;
    if (s[0] == s[n - 1])
        return ispalindrome(s.substr(1, n - 2));
