import java.util.*;

public class ThreePilesofCandies {
	public static void main(String[] args) {

		Scanner scn = new Scanner(System.in);

		int t = scn.nextInt();

		while (t > 0) {
			long sum = 0;
			int a = scn.nextInt();
			int b = scn.nextInt();
			int c = scn.nextInt();

			sum = a + b + c;
			if (sum % 2 != 0) {
				sum--;
			}

			long ans = sum / 2;

			System.out.println(ans);

			t--;
		}
	}

	public static void bubbleSort(int[] arr) {
		int n = arr.length;
		int temp = 0;
		for (int i = 0; i < n; i++) {
			for (int j = 1; j < (n - i); j++) {
				if (arr[j - 1] > arr[j]) {
					temp = arr[j - 1];
					arr[j - 1] = arr[j];
					arr[j] = temp;
				}

			}
		}
	}
}
