using namespace std;
typedef unsigned long long ull;
void pri(vector<ull> a,int n,int k){
    int count=0;
    ull s=0;
    for(int i=0;i<n;i++){
        s+=a[i];
        if(s%2!=0){
            if(count==(k-1)){
                cout<<n<<" ";
                break;
            }
            else
            cout<<i+1<<" ";
            s=0;
