['import java.io.*;
import java.util.*;
import java.lang.*;

public class codeforces_1196A {
    static class FastReader
        {
            BufferedReader br;
            StringTokenizer st;

            public FastReader()
            {
                br = new BufferedReader(new
                        InputStreamReader(System.in));
            }

            String next()
            {
                while (st == null || !st.hasMoreElements())
                {
                    try
                    {
                        st = new StringTokenizer(br.readLine());
                    }
                    catch (IOException e)
                    {
                        e.printStackTrace();
                    }
                }
                return st.nextToken();
            }

            int nextInt()
            {
                return Integer.parseInt(next());
            }

            long nextLong()
            {
                return Long.parseLong(next());
            }

            double nextDouble()
            {
                return Double.parseDouble(next());
            }

            String nextLine()
            {
                String str = "";
                try
                {
                    str = br.readLine();
                }
                catch (IOException e)
                {
                    e.printStackTrace();
                }
                return str;
            }
        }
    public static void main(String[] args) {
        FastReader ob = new FastReader();
        int t = ob.nextInt();
        for(int i=0;i<t;i++){
            long sum=0;
            for (int j = 0; j <3 ; j++) {
                sum+=ob.nextLong();
            }
            if(sum%2==0){
                System.out.println(sum/2);
            }
            else{
                System.out.println((sum-1)/2);
            }

        }
    }
}']

