        return [float(x) for x in stdin.readline().split()]
    else:
        return list(stdin.readline()[:-1])


for i in range(int(input())):
    n, k = arr_inp(1)
    a = arr_inp(1)
    odds = len(list(filter(lambda x: x & 1, a)))
    if odds < k or (odds - k) % 2:
        print('NO')
